import './App.css';
import { Helmet } from 'react-helmet';
import data from './data.json';
import ScoreComponent from './Components/ScoreComponent/ScoreComponent';

function App() {
  let scoreArr = [];

  return (
    <div className="App">
      <Helmet>
        <meta name="viewport" content="width=device-width, initial-scale=1.0" /> {/*displays site properly based on user's device -->*/}
        <link rel="icon" type="image/png" sizes="32x32" href="./assets/images/favicon-32x32.png" />
        <title>Frontend Mentor | Results summary component</title>
      </Helmet>
      <main>
        <div className="resultContainer">
          <h4>Your Result</h4>
          <div className="resultContainerCircle">
            <span className="resultContainerCircleScore">76</span>
            <span className="resultContainerCircleMaxScore">of 100</span>
          </div>
          <div className="resultContainerDescription">
            <h3>Great</h3>
            <p>You scored higher than 65% of the people who have taken these tests.</p>
          </div>
        </div>

        Summary

        {
          data.map((data, i) => (
            <ScoreComponent key={i} icon={data.icon} category={data.category} score={data.score} maxScore="100"/>
          ))
        }

        Continue

        <div class="attribution">
          Challenge by <a href="https://www.frontendmentor.io?ref=challenge" target="_blank">Frontend Mentor</a>.
          Coded by <a href="#">Your Name Here</a>.
        </div>
      </main>
    </div>
  );
}

export default App;
